    yystate(114, Ics, Line, Col, Tlen+1, Action, Alen);
yystate(149, [C|Ics], Line, Col, Tlen, Action, Alen) when C >= 65, C =< 70 ->
    yystate(114, Ics, Line, Col, Tlen+1, Action, Alen);
yystate(149, [C|Ics], Line, Col, Tlen, Action, Alen) when C >= 97, C =< 102 ->
    yystate(114, Ics, Line, Col, Tlen+1, Action, Alen);
yystate(149, Ics, Line, Col, Tlen, Action, Alen) ->
